import React from 'react'
export function IconVantagemTableTimes({size="50", color="#5236FF"}){
    return (
        <svg width="15" height="16" viewBox="0 0 15 16" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M13 2L2 14" stroke="#E46D6D" stroke-width="3" stroke-linecap="round" stroke-linejoin="round"/>
            <path d="M2 2L13 14" stroke="#E46D6D" stroke-width="3" stroke-linecap="round" stroke-linejoin="round"/>
        </svg>
    )
}
